import {Redirect} from 'react-router-dom';
//import './login.css';
import axios from 'axios';
import Modal from 'react-awesome-modal';
import TextField from "material-ui/TextField";
import RaisedButton from "material-ui/RaisedButton";
import MuiThemeProvider from "material-ui/styles/MuiThemeProvider";



class Userpage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            visible : false


        }
    }

       openModal() {
        this.setState({
            visible : true
        });
    }

    closeModal() {
        this.setState({
            visible : false
        });
    }


    render() { 
        return (   
            <div>

         <div>

                 {/* {this.renderRedirect()}
                    <button type="submit" onClick={this.setRedirect} style={{backgroundColor:"#007bff"  }}>Add User</button> */}

            <header className="heading">

     <nav className="toolbar_navigation">

    <div className="toolbar_logo">

                  <img
                          src={require("/home/nineleaps/Desktop/onproject/onproject/src/Component/pages/user/nine1.jpg")}
                          width="150"
                          height="70"
                          className="d-inline-block align-top"
                          alt="React Bootstrap logo"
                          />
    </div>
            <div className="spacer"/>
            <div className="toolbar_navigation-items">
                <ul >
                <li><a href='/Homepage'>Checklist</a></li>
                 <li><a href='/Userpage'>Users</a></li>
                 <li><a href='./writeblog'>Blog</a></li>
                 <li><a href='./faqdis'>FAQ</a></li>
                 <li><a href='/'>Logout</a></li>
                </ul>
            </div>
    </nav>
     <section>

                <input type="button" value="Add user" onClick={() => this.openModal()} />
   <Modal visible={this.state.visible} width="700" height="500" effect="fadeInUp" onClickAway={() => this.closeModal()}>
                    <div>
                        {/* <h1>Title</h1>
                        <p>Some Contents</p> */}

         <form>
            <br/>
                <div class="form-group">
                    <label for="formGroupExampleInput">First Name</label>
                    <input type="text" class="form-control" id="formGroupExampleInput" placeholder="Example input"/>
                </div>
                <div class="form-group">
                    <label for="formGroupExampleInput2">Last Name</label>
                    <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="Another input"/>
                 </div>
                 <div class="form-group">
                    <label for="formGroupExampleInput2">Place</label>
                    <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="Another input"/>
                 </div>

                 <div class="form-group">
                    <label for="formGroupExampleInput2">Designation</label>
                    <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="Another input"/>
                 </div>
                 <div class="form-group">
                    <label for="formGroupExampleInput2">Mobile</label>
                    <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="Another input"/>
                 </div>
          </form>
                   <a href="javascript:void(0);" onClick={() => this.closeModal()}>Close</a>
                   <a href="javascript:void(0);" onClick={() => this.closeModal()}>Save</a>
                    </div>
                </Modal>
            </section> 
</header>




                              <div class="footer">
                                        <p>Nineleaps</p>
                                    </div>
            </div>
</div>

        );
    }
}

export default Userpage;
